import React, { useEffect, useState } from "react";
import { getProvider, getMyNFTs, getEthBalance } from "../contractUtils";

export default function Inventory({ user }) {
  const [cars, setCars] = useState([]);
  const [houses, setHouses] = useState([]);
  const [balance, setBalance] = useState("0");

  useEffect(() => {
    async function fetchData() {
      const provider = await getProvider();
      const signer = provider.getSigner();
      const userAddress = await signer.getAddress();
      const nfts = await getMyNFTs(userAddress);
      setCars(nfts.filter(nft => nft.itemType === "car"));
      setHouses(nfts.filter(nft => nft.itemType === "house"));
      setBalance(await getEthBalance(userAddress));
    }
    fetchData();
  }, [user]);

  return (
    <div className="page-bg">
      <div className="container">
        <h1 className="page-title">Your Properties</h1>
        <div className="page-desc">
          View your owned houses and cars below. Use the Transfer tab to send an item.
        </div>
        <div className="asset-section">
          <h2 className="section-title">Houses</h2>
          <div className="asset-list">
            {houses.length === 0 && <div className="empty-msg">No houses owned.</div>}
            {houses.map((nft) => (
              <div className="asset-card" key={nft.tokenId}>
                <div className="asset-type">🏠</div>
                <div className="asset-title">{nft.name}</div>
                <div className="asset-detail">Worth: ${nft.value}</div>
                <div className="asset-detail">Purchased: {nft.purchaseDate}</div>
                <div className="asset-detail">Address: {nft.addr}</div>
                <div className="asset-id">NFT ID: {nft.tokenId}</div>
              </div>
            ))}
          </div>
          <h2 className="section-title" style={{ marginTop: 34 }}>Cars</h2>
          <div className="asset-list">
            {cars.length === 0 && <div className="empty-msg">No cars owned.</div>}
            {cars.map((nft) => (
              <div className="asset-card" key={nft.tokenId}>
                <div className="asset-type">🚗</div>
                <div className="asset-title">{nft.name}</div>
                <div className="asset-detail">Worth: ${nft.value}</div>
                <div className="asset-detail">Purchased: {nft.purchaseDate}</div>
                <div className="asset-detail">VIN: {nft.vin}</div>
                <div className="asset-id">NFT ID: {nft.tokenId}</div>
              </div>
            ))}
          </div>
        </div>
      </div>
      <style>{`
        .page-bg {
          min-height: 100vh;
          background: linear-gradient(120deg, #f8fafc 60%, #e0e7ff 100%);
          padding-bottom: 50px;
        }
        .container {
          max-width: 900px;
          margin: 44px auto 0 auto;
          padding: 0 16px;
        }
        .page-title {
          font-size: 2.3rem; font-weight: 800;
          margin-bottom: 6px; color: #1e293b;
        }
        .page-desc {
          margin-bottom: 32px;
          color: #64748b; font-size: 1.11rem;
        }
        .asset-section { margin-top: 16px; }
        .section-title {
          font-size: 1.45rem;
          color: #0d1331;
          font-weight: 700;
          margin-bottom: 12px;
          margin-top: 26px;
        }
        .asset-list {
          display: flex; flex-wrap: wrap; gap: 26px;
        }
        .asset-card {
          min-width: 220px; max-width: 260px;
          background: #fff;
          border-radius: 13px;
          box-shadow: 0 4px 24px #64748b10;
          padding: 18px 18px 13px 18px;
          display: flex; flex-direction: column; align-items: flex-start;
          margin-bottom: 13px;
          transition: box-shadow .17s;
        }
        .asset-card:hover { box-shadow: 0 4px 28px #6366f155; }
        .asset-type {
          font-size: 2.1rem; margin-bottom: 6px; opacity: 0.91;
        }
        .asset-title {
          font-size: 1.13rem; font-weight: 700;
          color: #3730a3; margin-bottom: 6px;
        }
        .asset-detail {
          color: #69718a; font-size: 1.02rem; margin-bottom: 2px;
        }
        .asset-id {
          font-size: 0.97rem; color: #b0b2c3; margin-top: 7px;
        }
        .empty-msg {
          color: #888; font-size: 1.04rem; padding: 19px 0 0 7px;
        }
      `}</style>
    </div>
  );
}
